import styled from "styled-components"

const PostPhotoContainer = styled.div`
  display: grid;
  grid-template-rows: 60px 230px 200px;
  justify-content: center;
  margin-top: 35px;

  .first-row {
    grid-row: 1;

  }

  .renderedPhotos {
    border-radius: 15px;
    width: 100px;
    height: 100px;
    object-fit: cover;

  }
`

export { PostPhotoContainer }
